import '../../styles/Premise.css';
import Header from './Header';
import PremiseElement from './PremiseElement';
import axios from 'axios';
import { useState, useEffect } from 'react';

function Premise() {
	const [primeses, setPrimeses] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3001/premise/notrenated');
                setPrimeses(response.data);
            } catch (error) {
                console.error('Ошибка загрузки данных:', error);
            }
        };

        // Загрузка данных с сервера при монтировании компонента
        fetchData();
    }, []);

	return (
	    <div>
			<Header/>
			<PremiseElement/>
        </div>
  	);
}

export default Premise;
